import React from 'react';
import tableContext from './tableContext';

import Td from './Td';
const Tr = ({data}) => {
	return (
		<tableContext.Provider value="dark">
			<>
				<tr>
					<Td>{data}</Td>
				</tr>
			</>
		</tableContext.Provider>
	);
};

export default Tr;
